    .firstshow {
        padding-top: 140px;
    }
    li {
        padding: 30px 0;
        background: black;
        margin-top: 30px;
        border-bottom: #555 1px dotted;
        border-bottom-width: 1px;

        a {
            color: #fff;
        }
    }

    .contact {
        border: none;
        border-radius: 0;
        padding-bottom: 70px;

        a {
            color: $primaryColor;
        }
    }
}

.left-text {
    z-index: 1;
}
.right-img {
    z-index: -1;
}

